import Card from './Card';

export default function Cards({characters}) {
    const onClose = () => window.alert("Emulamos que se cierra la tarjeta");
    return (
    <div >
       {characters.map(({name, species, gender, image}) => {
       return (
          <Card
          name={name}
          species={species}
          gender={gender}
          image={image}
          onClose={onClose}
          />
       );
       })}
    </div>
    );
 }
